      resolve: autoplayPlugin,
      options: {
        interval: 2000,
      }
    },
  ]}   
  animationSpeed={1000}
>
  <img src={Image} />
  <img src={Image} />
  <img src={Image} />
</Carousel>




        )
    }
}

export default HomeComponent
